data:
  definition: valeur la plus élevée du courant électrique qu'un circuit de sortie
    est capable d'interrompre dans des conditions spécifiées telles que tension de
    contact, nombre d'interruptions, facteur de puissance, constante de temps
  examples: []
  notes:
  - En courant alternatif la valeur efficace est spécifiée.
